// @ts-nocheck
import React, { useState} from 'react';

function Hero (){
  const [formData, setFormData] = useState({
    firstName: '',
    lastName: '',
    age: '',
    address: '',
    homeroomClassNumber: '',
    studentID: ''
  })
  function handleChange (e, field) {
    setFormData({
      ...formData,
      [field]: e.target.value
    });
  }
  return(
    <>
    <form>
      <input value={formData.firstName} onChange={(e) => handleChange(e, 'firstName')} />
      <input />
      <input />
      <input />
      <input />
      <input />
    </form>
    <h1>first name: {formData.firstName} <br /> last name: {formData.lastName}</h1>
    <h3>age: {age}</h3>
    <h6>address: {address}</h6>
    <p>homeroom class number: {homeroomClassNumber}</p>
    <p>student ID: {studentID}</p>
    </>
    )
}




















export default Hero;
